{'sentences': ['Genesee Regional Bank was formed in 1996 to serve small business clients in the Rochester, Watertown and Central New York communities.', 'As the Genesee Regional Bank grew and mortgage technology became more innovative, it began to evaluate its mortgage needs.', '“We sought out a solution that would help us evolve with the technology that was already beginning to change the shape of our industry,” said Joe Leone, Mortgage Operations Manager at Genesee Regional Bank.', 'GRB was introduced to nCino’s Mortgage Suite and the platform immediately stood out to the Bank.



', 'From this original vision, the Bank has grown rapidly to become one of the leading mortgage lenders in the region, with more than$800 million in assets.



']}
